import React, { useEffect, useState } from "react";
import Voiture from "./Voiture";

const ListeVoitures = () => {
  const [voitures, setVoitures] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/voitures")
      .then((response) => response.json())
      .then((data) => setVoitures(data.voitures))
      .catch((error) => console.error(error));
  }, []);

  const supprimerVoiture = (id) => {
    setVoitures(voitures.filter((voiture) => voiture.id !== id));
  };

  return (
    <>
      <table>
        <thead>
          <tr>
            <th>Marque</th>
            <th>Type de carburant</th>
            <th>Prix de location</th>
            <th>Image</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {voitures.map((voiture) => (
            <Voiture
              key={voiture.id}
              voiture={voiture}
              supprimerVoiture={supprimerVoiture}
            />
          ))}
        </tbody>
      </table>
    </>
  );
};

export default ListeVoitures;
